@RigidFlexibility @C_H The first thing you need to do is to think about developing a core position (the investment) and this is done using long term time frames. Combine that with short term trades within or close to the core. Profit is taken on the short term trades, while the core is allowed to run. You'd have made a lot more trading $ADMA short term, rather than investing - but building the core position is crucial.  

Controlling your risk is the best lesson, focus on what you can lose, not make. Plan your trade/investment to spread your risk.  

Good luck mate!

@C_H Never fall in love with a ticker. There are many good tickers, but, they're just numbers and nothing more. To name a very few, and easy to trade: $BTU $CEIX $INSW $LKNCY $PBF $SGML $STNG $TMDX $TNX $TRMD  

Risk and emotions are intertwined: you'll be much calmer and clear headed if you decrease your risk. 

Thanks for the compliments and good luck!

@EldenCrowe I imagine you bought Google as an investment without putting much thought when buying it, rather than averaging down and  reducing your risk. It's okay you planned for the long term, so you have to hold it either way. You should always think about plan A, B, C to enter any trade long/short term ...even day trades. 

$ADMA has been steadily rising with a distinguished trend and it's been super easy to trade in both the long and short term. The dynamics of $LKNCY are similar but with more chop. 

Anyway - good luck mate!

